import { FC, forwardRef } from 'react';

import { ForwardProps } from '../../types';

import List, { ListProps } from './List';

const UnorderedList: FC<ListProps & ForwardProps> = forwardRef(
  (props: ListProps, ref: ListProps['ref']) => <List {...props} variant='unordered' ref={ref} />
);

export default UnorderedList;
